INSERT INTO `organizations` VALUES (1,599571630068226,'Georgia Outreach LLC',NULL,'https://dl.airtable.com/.attachments/aae224a02fcec7c674a1c70d60c055fc/a9e0df49/georgiaoutreachlogo.png',NULL,'Georgia Outreach provides outpatient mental health professional services including medication management. They are a team of psychiatrists, licensed individual and family psychotherapists and professional counselors.  General services offered include; Psychiatry Services, Counseling and Pyschotherapy Services, Military members and Family Services, Anger Management Class, Professional Supervision \n\nEach provider brings their own unique way to providing care backed with years of training and experience.  Regardless of their professional back ground, each is committed to providing the care and treatment needed to get through any situation. \n','admin@georgiaoutreach.com',NULL,NULL,'https://www.georgiaoutreach.com/','Not vetted',3,NULL,NULL,NULL,NULL,'770511197625917,582785583063538,789259872814930','1223764135647595','982008775481883',843893991634406,'639387097779678,789421862693567,988970636517896,1193781551435948,1149777292769951,1160063855866694,616815450655447,618650255730163,1207857486716732,573698134502315,890080428886480,12472204215',NULL),(2,549646291248758,'Horizon Behavioral Health',NULL,'https://dl.airtable.com/.attachments/584f2b90e3d1886ca5a58852521ef44b/9a35b0fe/hopecounselinglogo.jpg',NULL,'Established in 2011, Horizon Behavioral Health (HBH) is a private multidisciplinary practice providing psychiatric, psychological and therapy services. HBH has grown exponentially over the past five years and has three offices: Hinesville, GA, Savannah, GA and Rincon, GA. With over thirteen providers and twenty administrative staff members, we approach each patient with a team effort of highly skilled professionals.\n\nOur patients are the cornerstone of our practice and we do our best to ensure an exceptional experience from beginning to end. From initial intake to navigating insurance, HBH believes in supporting our patients so that they never feel alone on their treatment journey. With an average of 3000 appointments available per month, we are sufficiently staffed so that our new patients can secure an appointment within a short time frame.\n\nDue to our proximity to Fort Stewart and Hunter Army Airfield, a large portion of our patients are active or retired military and their families. *We accept TRICARE and are a proud provider of the Veterans Choice Program. We are honored to be able to play a role in helping to maintain the mental health of the local military community. With many of our staff members being military spouses or veterans themselves, we have a unique perspective on the challenges of military life.\n\nContact our office at (912) 785-2100 to find out more about our services and how we can help to provide you with a comprehensive treatment plan.\n\n*Spouses and Dependents of Active Duty Military, as well as Retirees and their Dependents,  may self-refer to Horizon Behavioral Health. Our staff will happily obtain all the necessary TRICARE authorizations for you.','lauren.francis@hbhca.com',NULL,NULL,'https://www.hbhga.com/',NULL,4,NULL,NULL,NULL,NULL,'614002923690309','900571976097059','892746397861706',1170898698427115,'639387097779678,1164281363890417,1213394553614190,767948698346501',NULL),(3,567977363172359,'Introspection and Reflection',NULL,'https://dl.airtable.com/.attachments/ca17d97c76698faee591e48beb26f3a5/a99e3474/Introspectionreflection.png',NULL,'Community/Behavioral Health. Introspection & Reflection (INTROSPECTION & REFLECTION) is a behavioral health agency in Pooler, Georgia. Behavioral health centers are responsible for assuring the delivery of community based mental health, mental retardation, substance abuse and/or behavioral health services to individuals with those disabilities.','daysha@intospectionandreflection.com',NULL,NULL,'https://npino.com/behavioral-health/1467990119-introspection-&-reflection/','Not vetted',3,NULL,NULL,NULL,NULL,'1105393906140421,647403488137969','785541576275303,1281752689541066','958018420884621',1263119709592773,'639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1321861983203612,953369181551142,616815450655447,618650255730163,890080428886480,1213394553614190,7420884041551',NULL),(4,600407365797872,'Youth to Adult','Gateway Youth to Adult','https://dl.airtable.com/.attachments/bc40ac8c4b06ae70d3f64005292322e1/9d0d9609/0.jpg',NULL,'Youth to Adult is a grant funded program for young adults between the ages of 16-26 in Chatham County with a mental health and/or substance abuse diagnosis.  The goal is to increase the ability of the youth in reaching their mental wellness goals through connection to services, pro-social activities, mentoring, advocacy, trainings, or the purchasing of goods.','Jessica.Matthewson@Gatewaybhs.org','Gateway Youth to Adult Referral Form.docx (1).doc','https://dl.airtable.com/.attachments/2514b3d08c768e8fc3e7b1d5bb9f2853/38b36dc9/GatewayYouthtoAdultReferralForm.docx1.doc','gatewaybhs.org','Vetted',1,NULL,NULL,NULL,NULL,'1011898937693085,1173312953284982,604312751782605,838003184119997,1310498359536462','922278812748597','1226130516229368',1234406032412710,'639387097779678,915499537874128,953369181551142,1213394553614190,1242514362876733,1022757596728517,1091081542574390,639184920602996,748116754740747,1118923838832231,593506918155739,1259904023',NULL),(5,628015162783225,'Nelson\'s Counseling and Wellness',NULL,'https://dl.airtable.com/.attachments/b77412e9b084dfbfaa973f17f2d3ff4b/a1d73c80/nelson-family-counseling-primary-logo.png',NULL,'Offering individual, family, couples and group therapy. Other services include Anger Management, Pre-marital counseling and Grief therapy. CBT and DBT','Nelsoncounseling@gmail.com',NULL,NULL,'https://www.facebook.com/pages/category/Medical---Health/Nelsons-Counseling-and-Wellness-518700551849277/',NULL,4,NULL,NULL,NULL,NULL,'926720105305464','979635528465297','939639665379994',867414241818820,'639387097779678,1213394553614190',NULL),(6,675608168817870,'Viewpoint Care Management Entity',NULL,'https://dl.airtable.com/.attachments/20ce0088f5ee37ef7a1b8e5afe3fbb82/2aa7a3e3/viewpointlogo.png',NULL,'High Fidelity Wraparound/Intensive Customized Care Coordination (IC3) creates a team with the consumer as the leader including people that already known to the family (and others we may choose together) to create one unified plan to reach your goals. Viewpoint partners the consumer to a Care Coordinator who will provide intensive in-home support, community linkages, safety and crisis planning, team building, and a customized plan of care. Additionally, the consumer is partnered with a DBHDD Certified Peer Specialist who serves as a peer support offering advocacy, education, skills building, and empowerment working towards a family vision for a healthy and successful life together. We focus on identifying and developing strengths of the youth, family, and supports to help the consumer remain with you in your own communities. \n\nEmail referral form to email address located at the bottom of the referral form. ','susan.gattman@vphealth.org','Intensive-Custom-Care-Adult (4) viewpoint.docx','https://dl.airtable.com/.attachments/13fcd7cbb6b6cc00440914432d004366/90eb4e7c/Intensive-Custom-Care-Adult4viewpoint.docx','https://www.myviewpointhealth.org/about/programs-a-to-z/referrals/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1220861047788660,612656932930338','1040192431403484','1151042136691725',1095457030682112,'639387097779678,616815450655447,916621480733882,1213394553614190,593506918155739,767948698346501,1238519411173865',NULL),(7,732833359260751,'Georgia Health Partners LLC','GHP','https://dl.airtable.com/.attachments/32555e022e5fd3cff6ade04a02887f9d/d0cac3b9/georgiahealthpartners.jpg',NULL,'Referral form is attached. \n\nServices:\nIntensive Family Intervention (IFI),\nIndividual and Family Counseling,\nCommunity Support and Behavior Assistance,\nDiagnostic assessment,\nMedication administration,\nPsychosocial rehabilitation support,\nCase management,\nTrauma assessment,\nCore Services,\nLife Skills,\nRelaxation therapy,\nAddictive disease support services,\nBehavioral and Mental Health Assessments,\nPhysician and Nursing Assessments & Care,\n24 hour Crisis Intervention','vhills@gahealthpartners.com','GHP_Referral_Form(Savannah).doc.docx','https://dl.airtable.com/.attachments/24b8aa29271a53840e8a870f37036d7b/5c4ba4b6/GHP_Referral_FormSavannah.doc.docx','http://gahealthpartners.com/','Vetted',1,NULL,NULL,NULL,NULL,'1159485741041314,998543685222169,930229276349928,978060880101438,1303309890484687,1064866275306742','1005138863537264','1052979040721473',818219667663604,'639387097779678,789421862693567,616815450655447,639184920602996,608172149903977,944681815739354,1118923838832231,748116754740747,856368601852487,593506918155739,1259904023714336,1297919866260',NULL),(8,763326334047675,'Access Mental Health Agency','AAMH','https://dl.airtable.com/.attachments/be40a2c10e15aae25c0dbeee4fe68dd5/00912634/AAMHlogo.jpg',NULL,'AMHA offers a broad array of outpatient services provided by an experienced, dedicated professional staff of physicians, nurses, licensed therapists, certified addictive disease and behavioral health professionals, social workers, case managers, and mentors. \n\nThe AMHA team of physicians, nurses, licensed therapists, certified addictive disease and behavioral health professionals, social workers, and case managers provide a broad array of healthcare services designed to support your recovery and achievement of personal goals. Because life doesn&rsquo;t happen in an office, we provide most of our services in the community where we all live, work, play, worship, and socialize. We feel this is the most effective way to support real positive change in the lives of the individuals we serve. \n\nAMHA services include:\n\nindividual counseling for youths and adults\ngroup counseling for youths and adults\nfamily counseling for youths and adults\npeer support services, both individual and group, for adults\ngroup training for adults\npsychiatric medicine for youths and adults\nhealth assessments and medication education for youths and adults\ncrisis intervention services for youths and adults\naddictive disease support services for adults\ncomprehensive support services for youths\nrehabilitative services for adults\ncase management for adults \n\nFor all new intakes, Access Mental Health Agency requires a picture ID of youth (if applicable) and parent.  Access Mental Health Agency is always taking new referrals.  They will make sure all intakes are scheduled within a few  days of the referral and will schedule same day if the client is in crisis. All clients who receive services at Access Mental Health Agency must participate in individual counseling.','www.accessmha.com','Access Services Request Form IA-1.pdf','https://dl.airtable.com/.attachments/9c7afd4c8002168c61afba2f1b962b85/017888a9/AccessServicesRequestFormIA-1.pdf','www.accessmha.com','Not vetted',3,NULL,NULL,NULL,NULL,'937551110615945,1202752564499522,617381838606188,1255457630460866,1147764628593389,1315365588561585','637911491907869','776300774492735',1145634854238262,'791587286497701,1297919866260619,1242514362876733,1213394553614190,616815450655447,789421862693567,771052077935881,968949207637259,639387097779678,916621480733882,767948698346501',NULL),(9,857524097390237,'William Immel, LPC',NULL,'https://dl.airtable.com/.attachments/ea823467c4048c80e3b3ee278f19f097/009c8776/Bill-Immelpic.jpg',NULL,'Bill is a graduate of Rutgers University and has a Master&rsquo;s degree in Counseling from Rider University. He is licensed as a Professional Counselor by the State of Georgia and is a member of the American Association of Christian Counselors. Bill is also a Focus on the Family approved therapist. Bill has been providing individual, marital, family and group therapy for the past 22 years with areas of specialization including (but not limited to): anger management, divorce recovery, play therapy, depression, pornography addiction, and anxiety.\n\nBill and his wife Jennifer have two sons, Will and Rex.','barnabuscenter1@gmail.com',NULL,NULL,'https://barnabascenter.net/counselors/','Not vetted',3,NULL,NULL,NULL,NULL,'894922571429038','1215259700414238','983268101472067',975971103048489,'639387097779678,1193781551435948,1213394553614190,675333962875133,953369181551142,616815450655447,818831669488442,890080428886480,636015951022686,1243892237514253,689909481504179,122428819287',NULL),(10,876471803286413,'Andrea Elam, MS,  LPC, CPCS',NULL,'https://dl.airtable.com/.attachments/1bbd94466a2469ce0db53d20f9164c67/d2cc3d2d/andreaelam.jpg',NULL,'Ashley Elam  has experience working with children, adolescents, adults from various backgrounds; addressing: symptoms of depression, anxiety, domestic violence, schizophrenia, ADHD, bipolar disorders, and many other areas of their life.',NULL,NULL,NULL,'https://www.psychologytoday.com/us/therapists/andrea-elam-savannah-ga/139075','Not vetted',3,NULL,NULL,NULL,NULL,'1329762970101292,1056752533305847','1157110391844305','918057918783910',746221124185236,'639387097779678,616815450655447,953369181551142,821622375158469,1213394553614190,574787015241078,774801223398951,608362257859383',NULL),(11,830369986737903,'Adelle Burnsed-Geffen, PhD',NULL,'https://dl.airtable.com/.attachments/39cb84a91b61481e7e3babe2073fb663/add2b07d/adelleburnsed-geffen.png',NULL,'\nClose to 50% of Dr. Adelle Burnsed-Geffen\'s clients have Obsessive Compulsive Disorder (OCD). She treats other anxiety disorders inxlusing; Mood Disorders, ASD, Personality disorders, and ADHD. She uses CBT, Exposure Response Prevention, and Mindfulness.  Please provide her medical referrals when appropriate.\n\nDr. Burnsed-Geffen has a Ph.D in Clinical Psychology, licensed in Georgia in 1985, and has been practicing independently since that time. She continued her education through state and national psychological organizations as well as other approved medical education sponsors and peer supervision.   She has treated OCD for at least 15 years with children and adults.','psyctr1@aol.com ',NULL,NULL,'https://iocdf.org/providers/burnsed-geffen-adelle/','Not vetted',3,NULL,NULL,NULL,NULL,'652722551428232,1279395380631378,1297062497447591,873006420435590','822775222771959','1226239597576850',1250505501130350,'1213394553614190,1193781551435948,639387097779678,616815450655447,953369181551142,916621480733882',NULL),(12,887938623409132,'Hope Counseling Center of Savannah',NULL,'https://dl.airtable.com/.attachments/1947bd70819191de2da86e3e4939c6f2/30893236/hopecounselinglogo.jpg',NULL,'Hope Counseling provides services for youth from Early Childhood to Adolescence.  Services include; Individual Counseling, Social Skills via Group Therapy, Process Groups for Teens, School advocacy, Behavior Modification, Bullying Prevention, Grief and Divorce Recovery, Play Therapy, Animal Assisted Play Therapy.\n\nBased on their therapeutic needs, age, developmental level, personality and preference, your child&rsquo;s therapist will determine a uniquely individual treatment plan and counseling approach to use with your child. Therapeutic approaches may include talk therapy, play therapy, group therapy, or any combination of these.\n\n\nFor Adults, Hope Counseling offers a comprehensive and collaborative approach.  Adults working individually or in couples work are welcomed without judgment to explore their goals and concerns in a supportive and safe environment. Our approach with adults is collaborative and emphasizes hope as a catalyst for change and recovery.  Services include; Individual Counseling, Relationship/Marital Counseling, Grief and Divorce Recovery, Parenting/Co-parenting, Training & Workshops\n\nFor Families, Hope Counseling offers practical solutions.\nOur counselors support and assist families facing&#8232; life challenges, emphasizing effective problem solving and conflict resolution as well as improved communication.  Services include; Family Therapy, Grief and Divorce Recovery','ndrea@hopecounseling.center',NULL,NULL,'http://hopecounseling.center/','Not vetted',3,NULL,NULL,NULL,NULL,'1172223083606480','584003418223973,1147034944508724','570937720530982',1045777867810878,'639387097779678,771052077935881,968949207637259,988970636517896,689909481504179,1149777292769951,1160063855866694,1243892237514253,578290825124982,785935366286776,1254253296739887,95336918155',NULL),(13,903011084269923,'Melanie Mills, LPC, CACII,  ATR-BC',NULL,'https://dl.airtable.com/.attachments/ab5e096a370d545ac9f2fd8e468c9bf7/ab1bb599/meleniemillspic.jpg',NULL,'Using a collaborative approach, she works closely with you to provide a positive therapeutic experience. With over 25 years of clinical experience, she provides for many different populations of adults, couples, families and children with the belief that change and healing is possible - no matter the past. She can work with you in a more immediate solution-focused way to address a crisis, or at a deeper level to meet goals for long-term issues. As a Certified Addictions Counselor for nearly 20 years, she emphasizes progress, not perfection, and incorporate a non-judgmental attitude for those affected by substance issues.\n\nShe utilizes an affirming, reality-based approach to counseling based on individual needs using Cognitive Behavioral Therapy, Solution Focused Brief Therapy, 12 Step, or stress management. In addition to talk therapy, She is a Board Certified/Registered Art Therapist and trained in Sandtray Therapy. Visual expression is a powerful tool for concerns difficult to verbalize.\n\nEMDR relieves trauma and anxiety reactions and has been invaluable in my work with military, their families and other survivors. Learn to change your thinking, manage your emotions and accept your best self. ',NULL,NULL,NULL,'https://www.psychologytoday.com/us/therapists/melanie-mills-savannah-ga/95453','Not vetted',3,NULL,NULL,NULL,NULL,'1292926321263093','1223963668955517','987312017916323',661564729925858,'639387097779678,1193781551435948,890080428886480,1175779353594655,636015951022686,616486824376199,1247220421586706,1160063855866694,1243892237514253,1224288192870809,573698134502315,675333962',NULL),(14,932661260333112,'Youth Advocacy Program','YAP','https://dl.airtable.com/.attachments/c2dd1c0381ac526487c5854c4a7e1f86/b11e38a7/yaplogo.png',NULL,'Servicing Chatham County, Georgia, YAP began as a pilot program in 2011. As a collaborative effort with the Georgia Department of Juvenile Justice, Georgia YAP provides high fidelity wrap around services for juvenile offenders and since its start, has helped over 70 youth and families with 62% of youth not re-offending.\n\nOur services are individualized and tailored to meet specific needs of each youth. To enhance our program model, additional outcome based components are rendered to each youth as an added feature. The local program is under the leadership of a Director and our Advocates work hand-in-hand with each youth and family to ensure program success. Typically a youth is enrolled in the Georgia YAP program for a period of 6 months.\n\nExpansion for Georgia YAP is underway with growth in Chatham County and in other areas within the state.','lsimmons@yapinc.com',NULL,NULL,'http://www.yapinc.org/georgia','Vetted',1,NULL,NULL,NULL,NULL,'1218481608584904','1155064651413505','1114721937397983',1143267406656032,'1297919866260619,639387097779678,789421862693567,771052077935881,968949207637259,616815450655447,1213394553614190,767948698346501,1114719670054079',NULL),(15,888435226473868,'Malinda Graham and Associates',NULL,'https://dl.airtable.com/.attachments/94990b9bc55a9f1869d4ea7f2e887bd3/9cb29cfb/malindagrahamlogo.jpg',NULL,'Several Medicaid CORE services provided to consumers are:\n\nIndividual Counseling\nBehavioral Assistance \nFamily Training/Counseling\n24-Hour Crisis Intervention \nIntensive Family Intervention \nCommunity Support Individual\nSubstance Abuse Assessments and Treatment\nMedication Management\nDrug and Alcohol','khunter@mgrahaminc.com',NULL,NULL,'http://www.mgacommunityservices.com/','Vetted',1,NULL,NULL,NULL,NULL,'1285957073664741,922605061202834,999044906072274,932669087926292,951428791715303','615255280057117,782753254786542','1197180011238880',882026281098116,'1297919866260619,639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1193781551435948,953369181551142,616815450655447,1242514362876733,915499537874128,618650255730',NULL),(16,896081192730221,'Suicide Prevention Lifeline',NULL,NULL,NULL,'The National Suicide Prevention Lifeline is a United States-based suicide prevention network of 161 crisis centers that provides a 24/7, toll-free hotline available to anyone in suicidal crisis or emotional distress.',NULL,NULL,NULL,'https://suicidepreventionlifeline.org/',NULL,4,NULL,NULL,NULL,NULL,'965389027787296','1082867932424752',NULL,0,'639387097779678,1095053765654102',NULL),(17,933123882013147,'Developmental Disabilities Intake & Evaluation (Region 5)',NULL,NULL,NULL,'The Region 5 Field Office plans and oversees a network of public mental health, developmental disabilities, addictive disease and prevention services for 34 counties in Southeastern Georgia.  Counties in this region include Appling, Atkinson, Bacon, Bleckley, Brantley, Bryan, Bulloch, Camden, Candler, Charlton, Chatham, Clinch, Coffee, Dodge, Effingham, Evans, Glynn, Jeff Davis, Johnson, Laurens, Liberty, Long, McIntosh, Montgomery, Pierce, Pulaski, Tattnall, Telfair, Toombs, Treutlen, Ware, Wayne, Wheeler and Wilcox.',NULL,NULL,NULL,'https://dbhdd.georgia.gov/region-5-field-office',NULL,4,NULL,NULL,NULL,NULL,'688381173484043','1223791191486120','575226803930650',0,'639387097779678,767948698346501',NULL),(18,908935519698397,'Michael Lichtman, MD',NULL,'https://dl.airtable.com/.attachments/d2f61a59164ad4c8ad702ef078612f29/177d0eec/michaellichtmanpic.jpg',NULL,'Dr. Lichtman works in Statesboro, GA and specializes in Child & Adolescent Psychiatry and Psychiatry. His specialties include Neurology and Psychiatry. \n\nStatesboro Psychiatric Associates, our approach to treatment is comprehensive, using a combination of medication, newer technologies, and therapy as appropriate.  Ours is a team approach in which our board certified Psychiatrists, Physician Assistant certified in psychiatry and addiction, and Psychologist, work closely together to personalize and individualize treatments to suit each person&rsquo;s specific needs.  As a practice, we aim to treat the whole individual as a person and not as an illness, as an individual and not a type or category. We are here to help optimize your health, address your very specific concerns, and reach your goals for good health.\n',NULL,NULL,NULL,'https://www.statesboropsych.com/','Not vetted',3,NULL,NULL,NULL,NULL,'658756522884984,735549522463635,718582362503120','911949867147692','827392117018258',1162485668871511,'639387097779678,1193781551435948,1213394553614190,616815450655447,953369181551142,636015951022686,618650255730163,1160063855866694,890080428886480,1254253296739887,916621480733882,74208840415',NULL),(19,957645980497354,'The Barnabus Center for Counseling',NULL,'https://dl.airtable.com/.attachments/66427043faeb6d4a924ce3699229a824/7cc21e35/barnabaslogo.jpg',NULL,'The Barnabas Center for Counseling offers Christ-centered, Biblically-based counseling. We provide individual, marriage, and family therapy. Our therapists are state licensed and are trained to work with children, adolescents and adults. We deal with a vast array of issues, among them: victims of physical, verbal, and sexual abuse; ADD, depression, marriage and parenting issues, anxiety, panic disorders, pre-marital counseling, child and adolescent issues. We also offer a reduced fee for those that qualify.\n\nThe Barnabas Center additionally offers workshops and retreats on a variety of topics ranging from marriage enrichment to parenting skills. For more information, contact our office.','barnabuscenter1@gmail.com',NULL,NULL,'https://barnabascenter.net/','Not vetted',3,NULL,NULL,NULL,NULL,'624764578235708','1275228658146727','785753978316869',882067443578248,'639387097779678,1193781551435948,616815450655447,953369181551142,1213394553614190,755379262262385,767948698346501',NULL),(20,999476238928145,'Heads Up Guidance','HUGS','https://dl.airtable.com/.attachments/6e2436fea395af71099fd35421f02e99/f5f77806/hugslogo.jpg',NULL,'Heads-Up Guidance Services is a non-profit 501(c)(3) organization making Mental & Behavioral Health Counseling and Addiction Recovery Services available and affordable to ALL in need.  Services include; Mental Health, Addiction Recovery & Mentoring Services, Behavioral Health Services, Support Groups for Family & Friends of Clients, Teens & Adolescents, Family & Marriage, Counseling, Women&rsquo;s Abuse/Trauma Group, Vocational Guidance & Career Development  Opportunities, Parenting Skills, Spiritual Growth & Guidance, Social Skills & Recreational Therapy, Training in Life Skills & Financial Responsibility\n\nYouth Empowerment Services include the &ldquo;YES&rdquo; PROGRAM\nHUGS&rsquo; Counselors lead youth group discussions on topics important to their emotional health & social well being.  Group Sessions offered free of charge for clients between the ages of 12 and 18.','info@HeadsUpSavannah.org',NULL,NULL,'http://www.headsupsavannah.org/','Not vetted',3,NULL,NULL,NULL,NULL,'673606877270556','1287198807341402','1179109764528412',860772927661742,'639387097779678,821622375158469,747224856139696,616815450655447,1213394553614190,767948698346501',NULL),(21,970550221345922,'Epact Inc',NULL,'https://dl.airtable.com/.attachments/01a2540c20d269d58176f76c71906216/9c4a811b/epactlogo.jpg',NULL,'EPACT, Inc. works to improve the social, psychological, educational and economic conditions of families and communities through the provision of evidence-based services and community collaboration.\n\n\nEPACT, Inc. believes strengthening individuals and  families through a collective provision of  opportunities that solidify the community connection is the best way to operate in their best interests and build strong, cohesive neighborhoods.\n\nEPACT, Inc. collaborates with other social services agencies, families, schools and the courts to educate and empower individuals to become self-reliant contributors to their communities.  Helping to sustain the bond between individuals, families and the community operates in the best interests of our children and creates a foundation of collective community empowerment.\n\nOUR SERVICES\nFamily Preservation\nOut-of-Home Suppor\nPost Permanency\nFamily-Time Visitations\nParent\'s Cafe\nNetworking Center\nParent Partners Corner\nFood and Nutrition Market\nHealthy Kids Tote\nHealthy Life-Choice Program\nClothes Closet\nFirst Impressions\nThe Kids Room\nIn-Home Services\nMental Health Services\nFamily Visitation\nParenting Education\nFinancial Education Services\nJob Readiness Skills\nTransportation Services\nFoster Care Development\nInternships','epact-inc@hotmail.com',NULL,NULL,'https://www.epact-inc.com/','Not vetted',3,NULL,NULL,NULL,NULL,'860168572591516,1139231702630622,815373718172508','1262607973454058','606446291511615',828048791924989,'639387097779678,1213394553614190',NULL),(22,1063946909176619,'Atlantic Counseling',NULL,'https://dl.airtable.com/.attachments/152e33fb3aae96f0854fbed7a7ef235c/3aa816ea/AtlanticCounselinglogo.jpg',NULL,'Atlantic Counseling offers a variety of counseling and therapy services to meet your needs including; Individual and Family Therapy, PTSD, Coping with Deployment, Grief Counseling, Treatment of Anxiety and Depression, Couples Counseling, Substance Abuse Services, Addiction Services, Victim Counseling, Trauma Focused Brief Counseling.','atlanticcounselingservices@gmail.com',NULL,NULL,'https://www.atlanticcounselingservices.org/',NULL,4,NULL,NULL,NULL,NULL,'814251861537720','901206961205061','975897498556710',0,'639387097779678,1213394553614190,890080428886480,968949207637259,1330329970990630,1164281363890417,1175779353594655,618650255730163,636015951022686,789421862693567,1149777292769951,1247220421',NULL),(23,1094401029893949,'Lookout Mountain Care Management Entity',NULL,'https://dl.airtable.com/.attachments/20ce0088f5ee37ef7a1b8e5afe3fbb82/2aa7a3e3/viewpointlogo.png',NULL,'High Fidelity Wraparound/Intensive Customized Care Coordination (IC3) creates a team with the consumer as the leader including people that already known to the family (and others we may choose together) to create one unified plan to reach your goals. Viewpoint partners the consumer to a Care Coordinator who will provide intensive in-home support, community linkages, safety and crisis planning, team building, and a customized plan of care. Additionally, the consumer is partnered with a DBHDD Certified Peer Specialist who serves as a peer support offering advocacy, education, skills building, and empowerment working towards a family vision for a healthy and successful life together. We focus on identifying and developing strengths of the youth, family, and supports to help the consumer remain with you in your own communities. \n\nEmail referral form to email address located at the bottom of the referral form. ','lmcme@lmcs.org ','Intensive-Custom-Care-Adult (4) viewpoint.docx','https://dl.airtable.com/.attachments/13fcd7cbb6b6cc00440914432d004366/90eb4e7c/Intensive-Custom-Care-Adult4viewpoint.docx','https://www.lmcs.org/resources/','Not vetted',3,NULL,NULL,NULL,NULL,'1220861047788660,612656932930338',NULL,'1151042136691725',0,'639387097779678,616815450655447,916621480733882,1213394553614190,593506918155739,767948698346501,1238519411173865',NULL),(24,1066063275223463,'Kristin Fahey Counseling & Consulting',NULL,'https://dl.airtable.com/.attachments/3ef0582b8edd615fac3d22e76fd69f55/5e10173b/kristenfaheylogo.png',NULL,'Addiction & Substance Use Disorder, Social Worker - Clinical. ',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'915187481914425','777491857913804','1174565888439620',775625383874928,'639387097779678,1213394553614190',NULL),(25,1066842143635008,'Joye Psychology and Associates',NULL,'https://dl.airtable.com/.attachments/fa6c8eef5a94d62cb61a04501f6a7ecc/df7d0374/joyelogo.jpg',NULL,'We provide comprehensive diagnostic assessments and therapy for children, adolescents, and adults in Chatham County and the surrounding areas. \n\nASSESSMENT SERVICES\nWe offer personalized, comprehensive assessments in the following areas for children and adults: * Gifted and Talented * Kindergarten Readiness * Learning Disability * Academic Achievement/Grade-Level Readiness * College Academic Readiness * Attention-Deficit/Hyperactivity Disorder (ADHD) * Autism Spectrum Disorder and other developmental disorders (as young as 18 months old) * Intellectual Functioning * Mood Disorders * Anxiety Disorders.\n\nFor all grade-level assessments, we conduct differential diagnosis and offer written recommendations about school placement and accommodations as well as ways to work with your child or teen at home to maximize his or her success. For college-level assessments, we include in our reports recommendations aimed at maximizing the student\'s success. As needed, we can also provide IEP/504 Plan support, including attending school meetings.\n\nAssessment Procedure:  Assessments typically consist of an intake appointment, during which we will decide what testing is needed and agree on a price, a testing session, and a feedback session. Depending on your needs, testing can be divided into multiple sessions. \n\nTHERAPY SERVICES\nFor children and families: We offer therapy for issues including (but not limited to): * disruptive behavior disorders * academic problems * ADHD * Autism Spectrum Disorder * anxiety, fears, and phobias * noncompliance * tantrums. We also offer groups for children and their parents, including expressive arts, social skills, and parenting/support groups using a 1-2-3 Magic framework (123magic.com). \n\nSummer Camps: In mid-July, we will offer theme-based social skills camps for rising 1st through 5th graders. Groups will be small (6-8 children), last for one week, and engage children to learn social skills using Legos, magic, comic books, expressive arts, and other fun activities. Space is limited, so please let us know now if you are interested! \n\nSocial Skills Groups: Like our summer camps, social skills groups focus on learning social skills in a fun and engaging context. Currently, we have a Daniel Tiger group for 4-6 year old children, and we plan on continuing to add more ages as grow. Please sign up for our newsletter - we will announce new groups as they are scheduled! \n\nFor adults: We offer treatment for individuals and couples for a range of presenting issues, including: * depression * anxiety * interpersonal/relationship problems * adjustment issues * transition to college * issues related to self-esteem * gender/sexual identity * trauma. We hope to soon offer meditation groups for adults as well. \n\nFor all services: We use primarily evidence-based cognitive behavioral therapy for children and adults, which is problem focused and goal directed. Most issues can be effectively addressed in a short period of time (6 to 12 sessions). Treatment type and duration time will be individualized to meet the needs each patient. &#8203;\n','emorrissey@joyepsyc.com',NULL,NULL,'http://www.joyepsychology.com/','Not vetted',3,NULL,NULL,NULL,NULL,'1313245696952262,1235053669565274','909316241133034','624872025396095',937632561206587,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1175779353594655,1213394553614190,618650255730163,767948698346501',NULL),(26,1108209842099732,'May Institute',NULL,'https://dl.airtable.com/.attachments/6d3ad4576c3ba3328b6e4a2f63eefa4e/9f70b560/Mayinstitutelogo.jpg',NULL,'May Institute is a nonprofit organization that is a national leader in the field of applied behavior analysis, serving individuals with autism spectrum disorder and other developmental disabilities, brain injury and neurobehavioral disorders, and other special needs.\n\nFounded nearly 65 years ago, we provide a wide range of exceptional educational and rehabilitative services across the lifespan.\n\nThe organization is one of the largest and most well-respected providers of services and special education schools for children and adults with autism and other special needs in Massachusetts and in the U.S.\n\nMay Institute has evolved into a national network that serves thousands of individuals and their families annually. With corporate headquarters in Randolph, Mass., the organization operates more than 140 service locations in more than a dozen states across the country.','hthomas1@mayinstitute.org',NULL,NULL,'https://www.mayinstitute.org/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1045335164002943,1293034277716957,946915336980044,574876568698708','1181452283889795','587796586661919',1325952759579779,'639387097779678,1091081542574390,916621480733882,1213394553614190,767948698346501,1238519411173865,818831669488442,616815450655447,953369181551142,1242514362876733,992847711096148,61865025573',NULL),(27,1112271443337891,'The Clubhouse',NULL,'https://dl.airtable.com/.attachments/b8fd355a21ba1e8ae5fd56b3951625af/7fdc2ebf/Gateway-Logo-NEW.jpg',NULL,'The Clubhouse offer Seven Challenges curriculum, Moral Reconation Therapy (MRT). Disability services may be available for youth up to age 18 through a referral from DBHDD (912-303-1649). The Clubhouse is a substance abuse recovery model. ','alexander.buchanan@gatewaybhs.org','The Clubhouse Referral Form 2018.doc','https://dl.airtable.com/.attachments/be8156252b65d3184f2462d5bf681b95/aabd1346/TheClubhouseReferralForm2018.doc','gatewaybhs.org/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'644905287026058,1234652889946098,1214773529783595,1159638955231178,840554022119225,1041594795579452','854685172508860','754649737705617',959714851720583,'1297919866260619,639387097779678,771052077935881,968949207637259,616815450655447,791587286497701,915499537874128,578514860857586,618650255730163,916621480733882,1213394553614190,1297406763933',NULL),(28,1188157508639868,'Savannah Counseling Services (Gateway)',NULL,'https://dl.airtable.com/.attachments/f6968f545b1cb6d559d55879c614aafb/95d63580/Gateway-Logo-NEW.jpg',NULL,'Gateway Community Service Board charges based on a sliding fee scale in accordance with Georgia\'s Department of Behavioral Health and Developmental Disabilities Policy. The fee scale is based on family income and ability to pay. No one will be denied access to services due to inability to pay. Gateway also accepts Medicaid, WellCare, Amerigroup, and some private insurance. \n\nGateway also does not accept referrals but there is an Open Access held every day, Monday-Friday, from 8:30am to 10:00am. Consumers will need to pre-register by calling 1-866-557-9955. ','delphina.greene@gatewaybhs.org',NULL,NULL,'https://www.gatewaybhs.org/','Not vetted',3,NULL,NULL,NULL,NULL,'1097414935292876,1209000467748869,939058440382897,1263999077757169,1179920850787529','1055462335344100','1046407159111348',946854070779016,'1297919866260619,639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,846883653369076,618650255730163,890080428886480,1247220421586706,121339455361',NULL),(29,1209156844866073,'Southeast Second Chance',NULL,'https://dl.airtable.com/.attachments/5a41e4172ddfd88f2015a6d89e8d28bb/11224991/secondchanceimage.jpg',NULL,'Southeast Second Chance, Inc. was formed in 2007 to serve individuals, couples, and families with an array of life problems. The philosophy of the practice is to empower individuals to cope with, and solve, their problems, accentuating their strengths and unique capabilities. Cognitive-behavioral, relapse prevention and solution focused techniques are used to help people move on with their lives as quickly as possible. SESC treats all types of problems including depression, anxiety, substance abuse, major mental health disorders, issues related to development, including divorce, family reunification, aging, and young families with children and adolescents. These services include individual, couples, family (child and adolescent) services, mental health and psychological evaluations.\n\nForensic Services include court ordered evaluations and treatment as well as specialized mental health, parenting, problem sexual behavior, and domestic violence issues. Specialists offer evaluations and comprehensive treatment services to juveniles and adults dealing with problematic sexual behaviors. Services are encouraged for people who are not involved in the legal system. For our staff, ongoing training, ethical and resource development are an integral part of the program. Treatment groups are held weekly in Savannah, Brunswick, and Woodbine.','www.southeastsecondchance.org',NULL,NULL,'http://southeastsecondchance.org/','Not vetted',3,NULL,NULL,NULL,NULL,'959530722783451,738841126603687','1206688914761370,990581489303287','539012621432586,1087793265921318',1275874278517679,'639387097779678,771052077935881,968949207637259,988970636517896,1193781551435948,1149777292769951,1160063855866694,1224288192870809,616486824376199,818831669488442,953369181551142,61681545065',NULL),(30,1271207565206427,'Recovery Place Inc',NULL,'https://dl.airtable.com/.attachments/9efb5b7ec827bff802e59b052371982b/bd3fba3b/recoveryplacelogo.png',NULL,'Recovery Place was first established in 1984 as a treatment center for Savannah, GA residents to get the care they need for drug abuse, alcoholism, and behavioral health conditions. Recovery Place has since become fully accredited by the Commission on Accreditation of Rehabilitation Facilities (CARF) and has been named a best practices model facility as well.\n\nOur team of qualified clinical and medical professionals provide comprehensive care to help people get the attention and services that they need &ndash; all in our tranquil and comfortable rehabilitation facility. There is a wide range of treatment options for clients to choose from, including outpatient, partial hospitalization, or residential services, depending on your individual situation.\n\nSince 1984, we have helped over 20,000 people achieve recovery and better their lives through the therapy, medical attention, case management support, and additional services that Recovery Place offers. We want to help you get your life back and gain the confidence to succeed. We use a strengths-based approach with a fully licensed and caring staff.\n\nMeet Our Caregivers','jchisholm@recoveryplace.org',NULL,NULL,'https://recoveryplace.org/','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1253153125696748,787496351815691,1318620660326965,843020321321040','891022590186155','572222951228384',1329779272841786,'639387097779678,771052077935881,968949207637259,689909481504179,910547125138880,618650255730163,890080428886480,1213394553614190,767948698346501,1238519411173865',NULL),(31,1258030347645238,'Q and R Consultation Services, LLC',NULL,'https://dl.airtable.com/.attachments/a7f8b4c6038f7a9e97156b26621484b8/bd115b03/qandrlogo.png',NULL,'Q & R Consultation Services provides counseling services for individual, group and family therapy for children, adolescents and adults.','qandrconsultation@gmail.com',NULL,NULL,'https://www.facebook.com/qandrconsultationservicesllc/','Not vetted',3,NULL,NULL,NULL,NULL,'1161656636034713,1340354214481209,988348874108459','1280430268019655','1039507544346750,712300758206965',1291078742541334,'639387097779678,1297919866260619,771052077935881,968949207637259,689909481504179,821622375158469,910547125138880,1197045062186443,616815450655447,618650255730163,890080428886480,9166214807338',NULL),(32,1241524558231705,'C. Williams and Associates',NULL,'https://dl.airtable.com/.attachments/2d47433a9121412eac50f44a77688c8a/9b7a03fe/cwilliams.jpg',NULL,'Mental Health Counseling Services at C. Williams and Associates.\nMeet our providers:\nCORI WILLIAMS,  LPC -  She has extensive experience treating individuals with anxiety, depression and attachment issues. She is most passionate about advocating for individuals with developmental disabilities and their families.  She specializes in counseling individuals with developmental disabilities and autism. She strives to help them build their lives to their fullest potential.  She uses mindfulness, art and play within her practice to decrease anxiety in the clients she serves. She is willing to meet outside of the therapy office, in the most comfortable setting for the client.\n\nCHRIS WILLIAMS, LPC - He has experience treating individuals with depression, anxiety, as well as couples counseling. His experience in the mental health field began in 2003 and has worked with a variety of individuals dealing with a wide range of issues. His passion is working with couples dealing with communication difficulties, trust issues, as well as parenting style differences. He focuses on the individual as a whole and use a wide range of modalities such as Cognitive Behavioral Therapy, Person Centered, and Seven Challenges for adolescents. His goal is to meet each client where they are in the treatment process and provide individualized treatment planning to maximize your potential!\n\nNINA KENNEDY, LMFT - She works with individuals, couples and families of all ages. She specializes in depression/anxiety, marital issues, child behavioral issues, LGBTQ, and substance abuse. She is highly proficient in working with both voluntary and involuntary assessment and treatment. She has recently been voted 2018 Savannah\'s Best of the Best Therapist/Psychiatrist by Savannah Morning News. She believes people come to therapy because they want help. They want something to be different. She feels it is her place to help someone identify that and find ways they feel will get them where they want to be. \n\nJENN BOYD, LPC -  She has experience working with youth, adults, and families on a variety of different issues including suicidality, self harm, anxiety, depression, difficulty regulating emotions, and trauma. She utilizes a person-centered style of therapy, based on each individuals\' needs and have been trained in Dialectical Behavioral Therapy as well as Trauma Focused Cognitive Behavioral Therapy.  She strives to provide a safe environment to explore personal issues while also teaching skills to help manage overwhelming emotions and seek solutions. She enjoys incorporating mindfulness and other techniques into therapy to help implement these strategies, ultimately helping people learn the skills to become in control of their feelings and behaviors.  When one feels more in control of their emotions and the ability to tolerate distress, it can be easier to deal with the inevitable challenges we face.','www.cwilliamsandassociates.com','Organizational Referral Intake Packet cwilliams.docx','https://dl.airtable.com/.attachments/64d310fdd8619f41a52428d39b3e28ec/1ec7d9a7/OrganizationalReferralIntakePacketcwilliams.docx','https://cwilliamsandassociates.com/','Not vetted',3,NULL,NULL,NULL,NULL,'1184167324811540,1291526243548418,819830790386455,1315365588561585','1122969038292767','1276050815212765',1246039041277873,'639387097779678,789421862693567,771052077935881,968949207637259,1330329970990630,1193781551435948,1160063855866694,616815450655447,797229853250820,1213394553614190,1118923838832231,8563686018',NULL),(33,1264014271336859,'J C Lewis Primary Health Care Center',NULL,'https://dl.airtable.com/.attachments/e17adc79bce72a5d98c86107b77e166e/4242d20a/JCLlogo.jpg',NULL,'J.C. Lewis Behavioral Health program provides comprehensive behavioral health services  to  consumers of J C Lewis medical or dental  program.',NULL,NULL,NULL,'http://www.jclewishealth.org/services/behavioral-health-care-services/','Not vetted',3,NULL,NULL,NULL,NULL,'759040395154305,954329153684849,1189086167338399,1136801539838195','1199373240119152','1342101724204403',656232573636886,'1213394553614190,639387097779678,767948698346501',NULL),(34,1289247967843300,'Katherine Mckenzie, LPC',NULL,'https://dl.airtable.com/.attachments/7dc46619928147e7ba81ff6e1e9c09f0/41e356e1/katherinemckenzielogo.png',NULL,'Katherine D. McKenzie LPC is a female counselor in Savannah, GA.',NULL,NULL,NULL,NULL,NULL,4,NULL,NULL,NULL,NULL,'839236359897533','1253884668561909','873298214845556',1122887222515225,'639387097779678,1193781551435948,1213394553614190',NULL),(35,1308660189554945,'Georgia Crisis and Access Line (GCAL)','GCAL',NULL,NULL,'GCAL is available 24 hours a day, 7 days a week and 365 days a year to help you or someone you care for in a crisis. GCAL professionals will: provide telephonic crisis intervention services, dispatch mobile crisis teams, assist individuals in finding an open crisis or detox bed across the State, link individuals with urgent appointment services\nIn addition, GCAL will help you to access a State Funded provider in your area in a non-emergency as well.',NULL,NULL,NULL,'https://www.valueoptions.com/referralconnect/doLogin.do?j_username=gacm&j_password=gacm',NULL,4,NULL,NULL,NULL,NULL,'783922882600786','949606705786543',NULL,0,'639387097779678,1095053765654102',NULL),(36,1264690864853116,'Ashley Richbourg, LCSW',NULL,'https://dl.airtable.com/.attachments/1aba13a4f113afe7a384c720c271386d/1ee6064f/ashleyrichbourg.jpg',NULL,'Ashley Richbourg , LCSW is a licensed clinical social worker with a Masters of Social Work from the University of North Carolina at Chapel Hill. Ashley brings years of experience as an in-home individual & family therapist working with couples to strengthen and improve relationship skills. She now focuses her experience on providing solution based therapy to a range of clients with many different issues. She specializes in working with individuals and couples who are determined to focus on their strengths and build towards a better future.',NULL,NULL,NULL,'https://www.georgiaoutreach.com/therapists-3/ashley-richbourg-lcsw/','Not vetted',3,NULL,NULL,NULL,NULL,'577524491603345,794781737822351','1000710924307359','574794009437158',848899122442716,'639387097779678,1213394553614190,953369181551142,616815450655447,916621480733882',NULL),(37,1306784019365289,'Judy Saucerman, LCSW',NULL,'https://dl.airtable.com/.attachments/f13c9a2f3d6ad2ebfbc019334e5e1417/196d5f89/judysaucerman.jpg',NULL,'Judy Saucerman, LCSW is a licensed clinical social worker with over 20 years of experience doing therapy in outpatient, inpatient, substance abuse, forensic, agency and military clinics.  Wanting to know you and what you really need drives her interest in providing your therapy. She will guide you in exploring the real you, and helping you make sense of your thinking and decisions helps you arrive at new clarity and peace. Judy&rsquo;s years of experience and training will be utilized to help you learn the coping skills and tools to deal with what&rsquo;s bothering you.\n\nOur office offers a wide array of services to suit your current need. Each provider brings their own unique way to providing care backed with years of training and experience.  Regardless of their professional back ground, each is committed to providing you with the care and treatment you need to get through your situation. \n\nHere are some of our general services offered in through our office. Please take some time to learn more about what we offer so that you can identify what best suits you when you contact us. If you do not see what you are looking for, or if you need some guidance please do not hesitate to contact our office.\n\nServices:\n&bull; Psychiatry Services\n&bull; Counseling and Pyschotherapy Services\n&bull; Military members and Family Services\n&bull; Anger Management Class\n&bull;  Professional Supervision ',NULL,NULL,NULL,'https://www.georgiaoutreach.com/','Not vetted',3,NULL,NULL,NULL,NULL,'1211401859505005','946390674647798','766114163250573',1021481825385959,'639387097779678,1193781551435948,1213394553614190,1164281363890417',NULL),(38,1325705296267184,'Erin Adams, MAMFT, LPC, NCC',NULL,'https://dl.airtable.com/.attachments/c4a28eec110182a9aa5a8941c1fb3139/3c38ea22/erinadams.jpg',NULL,'Erin Adams is a graduate of Georgia Southern University and Psychological Studies Institute (PSI). PSI specializes in training Christian counselors. She holds a Masters in Marriage and Family Therapy. She is a Licensed Professional Counselor and a National Certified Counselor. A longtime member of the America Association of Christian Counselors, Erin has over 8 years&rsquo; experience in Christian counseling, counseling individuals, couples, families and groups. She has worked with the Department of Family and Children Services as well as with several Georgia community service boards offering her experience working with issues such as depression, anxiety, abuse and adjustment issues, bipolar disorder and women&rsquo;s issues.','barnabuscenter1@gmail.com',NULL,NULL,'https://barnabascenter.net/counselors/','Not vetted',3,NULL,NULL,NULL,NULL,'1128500137966321','855260068571176','637879152777206',788710545598112,'639387097779678,953369181551142,1213394553614190,616815450655447,890080428886480,636015951022686,1243892237514253,689909481504179,945978368279481,1193781551435948,578290825124982,122428819287',NULL),(39,1339182713147731,'Trauma Drama Therapy',NULL,'https://dl.airtable.com/.attachments/f19632bbc477363711e6b27a0044815d/cdc8d489/traumadramapic.jpg',NULL,'Has your child experienced a traumatic event such as physical or sexual abuse, the traumatic death of a loved one, or witnessing domestic violence? Such traumas are treatable when using evidence based Trauma Focused-Cognitive Behavioral Therapy. Research indicates that TF-CBT is the most successful treatment for traumatized children.\nI am a Certified Trauma Focused-Cognitive Behavioral Therapist. I can help your child address thoughts, feelings and behaviors that have been negatively affecting him or her. By adhering to this evidence based process, together we (parent/caretaker, child and therapist) can address trauma reminders and inaccurate or unhelpful beliefs.\nIf your child has experienced a traumatic event and you would like more information, please don\'t hesitate to contact me, Lorrie Rumpel, at Trauma Drama Therapy.','lrumpel@traumadrama.us',NULL,NULL,'https://www.psychologytoday.com/us/therapists/trauma-drama-therapy-savannah-ga/154733','Vetting In Progress',2,NULL,NULL,NULL,NULL,'1178329697630860','1225987825999811','680724149779279',588559626701281,'1297919866260619,639387097779678,789421862693567,771052077935881,988970636517896,675333962875133,944379166032449,818831669488442,953369181551142,616815450655447,1213394553614190,7679486983465',NULL);
