45,'GCAL is available 24 hours a day, 7 days a week and 365 days a year to help you or someone you care for in a crisis. GCAL professionals will: provide telephonic crisis intervention services, dispatch mobile crisis teams, assist individuals in finding an open crisis or detox bed across the State, link individuals with urgent appointment services\nIn addition, GCAL will help you to access a State Funded provider in your area in a non-emergency as well.',NULL,'https://www.valueoptions.com/referralconnect/doLogin.do?j_username=gacm&j_password=gacm',NULL,NULL,'854998659962292,1340989608448798,958354828684061,903871677224270,1145089114996156,607877021725861,969427174556833,873091224397599,1002100520878338,932804893629052,918858089518250,850189215189',NULL,NULL,NULL,NULL,NULL,'949606705786543',NULL,NULL,'639387097779678,1095053765654102,767948698346501',NULL,NULL,NULL),(23,843020321321040,'Recovery Place Substance Use Assessment',NULL,1271207565206427,'Programs that conduct an evaluation to determine whether an individual has a substance use disorder based on a pathological set of behaviors related to use of that substance as well as the nature and extent of the problem. Diagnostic criteria include inability to control or limit the amount taken or the frequency; intense cravings; continuing use despite problems with work, school or family/social obligations or interpersonal problems; risky use, e.g., diving a car or operating machinery while under the influence; or evidence of pharmacological indicators (tolerance and withdrawal symptoms), the adjustment the body makes as it attempts to adapt to the continued and frequent use of a substance.','572222951228384','https://recoveryplace.org/',NULL,'Not vetted','1092041112040756,1248610812578442',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1213394553614190,639387097779678,767948698346501,1238519411173865','1282583230320152',NULL,NULL),(24,838003184119997,'YTA Mental Health Support Services',NULL,600407365797872,'An occupationa