ts of illnesses; and are licensed to prescribe medication, conduct physical examinations, order and interpret laboratory tests and EEGs and order brain imaging studies such as CT, CAT, MRI and PET scans as well as evaluate and treat psychological and interpersonal problems and provide continuing psychiatric care. May include medication management as well. ','574794009437158','http://www.georgiaoutreach.com/personnel/ashley-richbourg-lcsw/',NULL,'Not vetted','1092041112040756,870618126693777,958199564483090,1063427259643927,666142468264925,958354828684061,1193129020060220,1253165932307636,1276346987127390',NULL,NULL,NULL,NULL,NULL,'1000710924307359',NULL,'848899122442716','639387097779678,1213394553614190,953369181551142,616815450655447,916621480733882','772724587330531',NULL,NULL),(26,819830790386455,'C. Williams & Assoc. Autism Services',NULL,1241524558231705,'A developmental disorder that affects communication and behavior, and includes symptoms that impair the individual\'s ability to function properly in school, work and other areas of life. Although autism can be diagnosed at any age, it is said to be a \"developmental disorder\" because symptoms generally appear in the first two years of life. Autism is also known as a \"spectrum\" disorder because there is wide variation in the type and severity of symptoms people experience. People with ASD have difficulty with social communication and interaction (e.g. lack of eye contact, voice tones that sound sing-song or robotic, facial expressions or gestures that don\'t match what is being said), restricted interests (e.g., intense interest in numbers, details, facts), restrictive/repetitive behavior (e.g., repeating words or phrases, getting upset at changes in routine or sensory input such as light or noise). People with ASD may also experience sleep problems or irritability, but also have many strengths including the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','1276050815212765','www.cwilliamsandassociates.com',NULL,'Not vetted','948640260098758,1258328669902758,841542262835583,572201425996280',NULL,NULL,NULL,NULL,NULL,'1122969038292767',NULL,'1246039041277873','639387097779678,789421862693567,771052077935881,968949207637259,988970636517896,1330329970990630,689909481504179,1193781551435948,1160063855866694,797229853250820,616815450655447,121339455361','772724587330531','3/6/2019 16:01:45',NULL),(27,814251861537720,'Atlantic Mental Health Counseling',NULL,1063946909176619,'Programs that provide diagnostic and treatment services for individuals whose psychiatric problems or other emotional difficulties are not severe enough to require 24-hour care but who can benefit from regular consultation and therapy with a mental health professional.','975897498556710','https://www.atlanticcounselingservices.org/',NULL,'Not vetted','1340989608448798,1310796733159033,1323738845135200,785263765755558,799387826971055,633127587151884,1002100520878338,859893932453608,1069987160604560,666142468264925,958354828684061,9038716772',NULL,NULL,NULL,NULL,NULL,'901206961205061',NULL,NULL,'921465972457943,578290825124982,1207857486716732,945978368279481,771052077935881,1297919866260619,789421862693567,968949207637259,791587286497701,1224288192870809,1160063855866694,12472204215','612456167732948',NULL,NULL),(28,860168572591516,'EPACT Mental Health Counseling',NULL,970550221345922,'Programs that provide diagnostic and treatment services for individuals whose psychiatric problems or other emotional difficulties are not severe enough to require 24-hour care but who can benefit from regular consultation and therapy with a me