ine or sensory input such as light or noise). People with ASD may also experience sleep problems or irritability, but also have many strengths including the ability to learn things in detail and remember information for long periods of time; being strong visual and auditory learners; and excelling in math, science, music or art. But although ASD can be a lifelong disorder and while children who have ASD have difficulty in talking, playing with other children, and relating to others, including their own family, treatment and services can improve their symptoms and ability to function.','624872025396095','http://www.joyepsychology.com/',NULL,'Not vetted','666142468264925,572201425996280,1258328669902758,841542262835583',NULL,NULL,NULL,NULL,NULL,'909316241133034',NULL,NULL,'639387097779678,1160063855866694,1243892237514253,1320420504969618,636015951022686,1175779353594655,1213394553614190,618650255730163,767948698346501','629797810057384','3/20/2019 13:19:13',NULL),(74,1209000467748869,'Savannah Counseling Mental Health Assessment',NULL,1188157508639868,'Programs that provide screening, diagnostic and treatment planning services for people who are experiencing acute or chronic psychiatric problems. Included is a continuum of assessment services ranging from a comprehensive psychiatric or psychological evaluation to the administration of one or a combination of psychological tests to examine a particular personality variable. Services may be provided in a variety of settings including hospitals and community-based clinics.','1046407159111348','https://www.gatewaybhs.org/',NULL,'Not vetted','958199564483090,1221079003260559,1186966820343593,958354828684061,1145089114996156,1259576995540885,1231209990652272',NULL,NULL,NULL,NULL,NULL,'1055462335344100','1215363497097119',NULL,'639387097779678,1297919866260619,789421862693567,771052077935881,968949207637259,988970636517896,1160063855866694,618650255730163,890080428886480,1247220421586706,846883653369076,121339455361','90914